import React from "react";
import { Route, Routes } from "react-router-dom";
// import ReactPlayer from "react-player";
import "./App.scss";
import Home from "./components/Home";
import MainSlide from "./components/main-hero/MainSlide";
import MoviesSlide from "./components/movies-slide/MoviesSlide";
import MovieDetail from "./components/movies-slide/MoviesSlide";

function App() {
  /*
  const response = axios.get(
    `https://api.themoviedb.org/3/genre/movie/list?api_key=977df55b389183b892b6c11af75af168&language=en-US`
  ).then(respon =>  console.log(respon.data.results))

  <ReactPlayer url={`https://www.youtube.com/watch?v=a8Gx8wiNbs8`} />
  */

  return (
    <div className="app-container">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/movie/:movieId" element={<MovieDetail />} />
      </Routes>
      <MainSlide />
      <MoviesSlide endpoint="top_rated" title="Top Rated" />
      <MoviesSlide endpoint="popular" title="Popular" />
      <MoviesSlide endpoint="upcoming" title="Upcoming" />
    </div>
  );
}

export default App;
